import './Section1.css';
import Fleche_Bas from '../static/fleche_bas.svg';
import Fleche_Bas_Purple from '../static/fleche_bas_purple.svg';
import Fleche_Bas_Black from '../static/fleche_bas_black.svg';

const Section1 = (buttonFct) => {
    return(
        <div id="section1">
           {
               //<div class="carre" id="c1"></div>
               //<div class="carre" id="c2"></div>
               //<div class="carre" id="c3"></div>
           } 
           <div className="ombre ombre1">Stanislas</div>
           <div className="ombre ombre2">software developer.</div>
           <div className="main_title">
            <h1>Hi,</h1>
            <h1>I'm Stanislas,</h1>
            <h1>software developer.</h1>
        </div>
            <img className="PDP" alt="Image profil Stanislas" src={Stan} /> 
            <div className="ombre_cercle"></div>
            <div className="ombre_cercle2"></div>
            <img className="down_arrow" alt="down arrow to go to resume" src={Fleche_Bas} onClick={buttonFct} />
            <img className="down_arrow da2" alt="down arrow to go to resume" src={Fleche_Bas_Purple}/>
            <img className="bg_shape" src={Fleche_Bas_Black}/>
        </div>
    )
}

export default Section1;
